    public static final String CAMEL_SOURCE_VERTXKAFKA_COMPONENT_SOCKET_CONNECTION_SETUP_TIMEOUT_MAX_MS_CONF = "camel.component.vertx-kafka.socketConnectionSetupTimeoutMaxMs";
